function ProfilemodalRow ({Icon,title}) {
    return (
        <div className="justify-center">
        <div className="items-center justify-between bg-gray-300 py-1 px-3 text-gray-600 hover:bg-cyan-400 rounded-full cursor-pointer group">
           {Icon && <Icon className="inline-block h-5 w-5 text-gray-500 group-hover:text-white"/>}
           <p className= "inline-block px-1 text-sm sm:inline-flex font-medium text-gray-500 group-hover:text-white">
               {title}</p> 
        </div>
        </div>
    )
}

export default ProfilemodalRow;
